-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,,>
-- =============================================
CREATE PROCEDURE [SP_Tasa]
	-- Add the parameters for the stored procedure here
	
	@fechaInicio datetime,
	@fechaFinal datetime
AS
BEGIN
	-- SET NOCOUNT ON added to prevent sys.sp_ActiveDirectory_Startextra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	SELECT sum(tasa)*100 as Tasa FROM tasasomisiones where fecha between @fechaInicio and @fechaFinal
END

